import React from "react";
import Header from "../src/components/header/Header.components";

import  Features  from "../src/components/features/features.components";
import  Hot  from "../src/components/hot/hot.component";
import Category from "../src/components/category/category.component";
//import Forum from "../src/components/forum/forum.component";
import HeaderBox from "../src/components/header.box/header.box.components";
import Footer from "../src/components/footer/footer.component";



import "./App.scss";


function App() {
  return (
    <div className='App'>
      <Header />
      <HeaderBox />
        <Features />
        <Hot />
        <Category />

      <Footer />
    </div>
  );
}

export default App;
